import React from "react";
import "./Header.css";

const Header = props => (
  <div className="jumbotron">
    <h1 className="header">{props.children}</h1>
    <div className="row">
      Score: {props.score} High-Score: {props.highscore}
    </div>
  </div>
);

export default Header;
